import React from "react";

const CheckoutPage = (props) => {
  return (
    <>
      <h3>Checkout Page</h3>
      <table
        width="100%"
        rules="rows"
        style={{
          width: "100%",
          height: "200px",
          borderBottom: "1px solid",
        }}
      >
        <tbody style={{ fontSize: "1.2em" }}>
          <tr>
            <th>Subtotal</th>
            <td>$600</td>
          </tr>
          <tr>
            <th>Ohio State Tax 9%</th>
            <td>$700</td>
          </tr>
          <tr>
            <th>Shipping</th>
            <td>DHL or Fedex (+ $17)</td>
          </tr>
          <tr style={{ fontSize: "1.4em" }}>
            {" "}
            <th>Total</th>
            <td>950</td>
          </tr>
        </tbody>
      </table>
    </>
  );
};

export default CheckoutPage;
